        "job_description": "JUNIOR FRONTEND DEVELOPER OPPORTUNITY WITHIN A LUXURY RETAIL BRAND\n• Junior Front End Developer role in Central London for a Computer Science Graduate (or similar)\n• Attractive benefits package\n• Up to £40,000 per annum depending on experience\n\nWho you will be working for\n\nOur client is a distinguished London-based jewellery brand with a bold vision, celebrated for their exquisite designs and distinctive layering pieces. Their brand ethos transcends jewellery, as they continuously expand their collections, engage in collaborations with emerging creatives, and make significant contributions to environmental sustainability.\n\nThey are currently seeking a passionate and enthusiastic Junior Front-End Developer with experience in Shopify development to join their dynamic and innovative team.\n\nBenefits\n• Private Healthcare\n• Bonus Scheme\n• Employee Discount\n• Summer working hours\n• Regular social events\n\nKey Responsibilities:\n• Develop, enhance, and maintain custom Shopify themes and apps.\n• Collaborate closely with designers and back-end developers to create responsive, high-performance web pages.\n• Write clean, maintainable, and well-documented code.\n• Implement and optimise web designs using expertise in SCSS, HTML, and Vanilla JavaScript.\n• Customise Shopify functionalities using Liquid templates and scripts.\n• Ensure cross-browser compatibility and optimisation for mobile devices.\n• Troubleshoot and resolve front-end issues and bugs.\n• Stay up to date with the latest industry trends and technologies.\n\nRole Requirements:\n• Degree: You must hold a degree in Computer Science or a related field.\n• Skills: Front End Development with good knowledge of Shopify. Proficient with JavaScript, CSS and HTML. (Liquid - desired)\n• Eligibility: You MUST be based in the UK and have the right to work in the UK. Unfortunately, this role does not offer visa sponsorships. Post Graduate Visa applicants will NOT be considered unfortunately.\n\nTo be considered\n\nPlease apply by clicking online or emailing me directly at . For further information please call me on . By applying for this role, you give express consent for us to process & submit your application to our client in conjunction with this vacancy only.",
