        "job_description": "Senior Web Engineer, Activation – Ruby at Ably\nSenior Web Engineer, Activation (Ruby)London, UK (Remote)Our everyday digital experiences are in the midst of a realtime revolution. Whether attending an event in a virtual venue, receiving realtime financial information, or working with colleagues in an online collaborative environment – consumers simply expect realtime digital experiences as standard. Ably provides a suite of APIs to build, extend, and deliver powerful digital experiences in realtime, delivering billions of messages for millions of devices every day and supporting organizations like Split, Hubspot, Toyota and Genius Sports.Working at Ably means helping to build the infrastructure and technology that will power and shape the future of the internet. And we’d like your help.About this roleYou will be responsible for helping shape the future of our frontends, making decisions that have a long lasting impact by building and delivering improvements and new features to our documentation, customer dashboards, and internal tools.You’ll also work with people all across Ably as the projects we work on touch many different parts of the company.You’ll be a key member of the Activation mission, contributing to strategic initiatives that drive developers to the Ably website, as well as increase sign ups and engagement over time.\nDeliver quality code. You’ll be hands-on with development to build and deliver improvements and new features to Ably’s customer-facing and internal frontends.\nYou’ll be helping steer the direction of our frontends, including our component library, used by multiple teams to deliver a consistent identity for Ably no matter where people see us online.\nYou’ll also work with people all across Ably as the projects we work on touch many different parts of the company.\nWhether it’s deliberately refactoring code to make our lives easier or updating our processes to be more effective, you’ll work to improve frontend development through improved engineering practices.\nDevelop effective testing strategies. You’ll constantly influence how we can improve our testing setup, helping the team unlock more potential along the way. We have an active vulnerability disclosure program, and from time to time you’ll be responsible for helping to resolve some extremely creative reports from security researchers.\nWe help support our internal users when they have issues with our systems, or if they can’t help resolve a customer issue without our intervention.\nStrong Ruby & Ruby on Rails skills and significant professional experience using these technologies.\nProficiency with modern HTML, CSS and JavaScript. Our frontends are a mix of technologies, and you’ll be supported by great frontend developers.\nA full-stack mindset and experience building full-stack applications with CI/CD, as well as understand and promote the importance of the latter.\nExperience with writing automated tests for software with tools like RSpec, Cypress (or Capybara/Cucumber).\nA solid grasp of Agile, Kanban and SCRUM principles and experience working with stakeholders to create and manage backlogs and delivery of work.\nExperience with modern frameworks such as React, Gatsby & TailwindCSS.\nHuntsBot,a one-stop outsourcing task, remote job, product ideas sharing and subscription platform, which supports DingTalk, Lark, WeCom, Email and Telegram robot subscription. The platform will push outsourcing task requirements, remote work opportunities, product ideas to every subscribed user with timely, stable and reliable.",
