        "job_description": "Provides advanced level system analysis, design, development, and implementation of applications and databases, under general direction.\n\nApplication engineer\n\nAbout Vanguard\n\nVanguard is one of the world's largest investment management companies, with around 380 low-cost traditional funds and ETFs, operating in 19 locations worldwide with about 20 million clients and 16,600 crew members.\n\nVanguard crew members come from a variety of different backgrounds and form a trusting, supportive community in which all crew members worldwide feel a sense of belonging. We believe our culture of inclusion is essential for each of us to fully thrive in our careers and to provide superior value to our clients and communities. \n\nThe role of our Attract team\n\nThe Attract team at Vanguard is a key to the development and running of the European public websites across private and professional investors.\n\nWe work with exciting and leading technologies within a microservice architecture and container-based infrastructure on Amazon Web Services (AWS), CI/CD best practices and BDD.\n\nApplication engineers with strong angular and java skills can expect to have a key role in implementing new features that will drive customer value and business outcomes. Candidates should be interested in a fast-paced group that builds, supports, and enhances global applications.\n\nCore Responsibilities\n\nCapable of designing solutions, writing code, testing code, automating test and deployment\n\nWork effectively with a high degree of autonomy within a collaboratively minded team\n\nTranslates technical specifications, and/or logical and physical design into code for new or enhancement to projects for internal clients.\n\nDevelops code and test artifacts that reuse subroutines or objects that are well structured and backed by automated tests\n\nEmploys contemporary software development techniques to ensure tests are implemented in a way that supports automation\n\nProvides system analysis, design, development, and implementation of applications and databases for client/server-, Web-, and/or PC-based software or middleware. Integrates third party products.\n\nElevates code into the development, test, and Production environments on schedule. Provides follow up Production support. Submits change control requests and documents.\n\nThoroughly understands software development methodology. Thoroughly understands architecture standards. Trains and mentors staff with less experience. Resolves issues elevated from staff with less experience.\n\nParticipates in design, code, and test Inspections throughout life cycle to identify issues. Explains technical considerations at related meetings, including those with internal clients.\n\nPerforms systems analysis, including system requirements analysis and definition (e.g., prototyping), and logical and physical design.\n\nWrites the system/technical portion of assigned deliverables.\n\nCommunicates systems issues at the appropriate technical level for each audience.\n\nThoroughly understands and complies with IT policies and procedures, especially those for quality and productivity standards that enable the team to meet established milestones. Thoroughly understands and complies with all Information Security policies and procedures, and verifies deliverables meet Information Security requirements.\n\nKey Skills:\n• Strong knowledge of Angular 13+\n• Experience with Apache Maven and NodeJS\n• Strong knowledge of Java 8 and Java 11\n• Experience with AWS technologies (ECS, S3, Cloudfront, DynamoDB, Lambda)\n• Experience in an Agile processes and CI/CD pipelines\n• Experience in testing methodologies and tools such as Jest, Protractor and Cypress\n• Strong analytical, verbal and written communication skills\n• Ability to work autonomously\n• Ability to work with a large range of stakeholders eg. engineers, business and architects\n\nQualifications\n• Minimum of four years related work experience, with development experience.\n• Undergraduate degree or equivalent combination of training and experience. Graduate degree preferred.\n\nVanguard are not offering visa sponsorship for this role.\n\nHow We Work\n\nVanguard has implemented a hybrid working model for the majority of our crew members, designed to capture the benefits of enhanced flexibility while enabling in-person learning, collaboration, and connection. We believe our mission-driven and highly collaborative culture is a critical enabler to support long-term client outcomes and enrich the employee experience.",
